}
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <LinkContainer to="/">
          <Navbar.Brand className="d-flex align-items-center justify-content-center">
            {/* Center logo and animated text horizontally */}
            <div className="brand-and-text">
              <img src={logo} alt="" style={{ width: 50, height: 50 }} />
              <span className="code-collab">CodeCollab</span>
            </div>
          </Navbar.Brand>
        </LinkContainer>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <LinkContainer to="/chat">
              <Nav.Link>
                Chat{" "}
                <i
                  className="fas fa-comments home-message-icon"
                  style={{ color: "blue" }}
                />
              </Nav.Link>
            </LinkContainer>
            {user && (
              <NavDropdown
                title={
                  <>
                    <i
                      class="fa-solid fa-user-large"
                      style={{ color: "blue" }}
                    ></i>
                    {user.name}
                  </>
                }
                id="basic-nav-dropdown"
              >
                <NavDropdown.Item href="#action/3.2">
                  Another action
                </NavDropdown.Item>
                <NavDropdown.Item>
                  <Button variant="danger" onClick={handleLogout}>Logout</Button>
                </NavDropdown.Item>
              </NavDropdown>
            )}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavigationL;
